    for i in xrange(3):
        rk[i] = sgn(out_p(xp[i], yp[i], xp[i-2], yp[i-2], xk, yk))
    k_in = (rk[0] == rk[1] == rk[2])
    rs = [0]*3
    for i in xrange(3):
        rs[i] = sgn(out_p(xp[i], yp[i], xp[i-2], yp[i-2], xs, ys))
    s_in = (rs[0] == rs[1] == rs[2])
    print "OK" if k_in ^ s_in else "NG"

